  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:25.846343\",\n\t\"name\": \"evaluation-of-management-actions-to-assess-habitat-changes-that-affect-target-resources-an\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The goal of this project is to improve
  management on Conboy Lake and Toppenish National Wildlife Refuges. Information obtained
  through the project will deliver adaptive management strategies and achieve several
  wildlife and habitat objectives defined in the Conboy Lake NWR Comprehensive Conservation
  Plan and Toppenish NWR Comprehensive Conservation Plan (CCP) goals and objectives.
  We propose the following:1. Conduct surveys for Oregon spotted frog egg masses to
  continue the long term dataset and evaluate and plan management actions.2. Work
  with partners on western gray squirrel surveys to understand gray squirrel use of
  the refuge and inform management decisions for forested habitat.3. Purchase, install,
  and monitor water temperature loggers within Cold Springs Ditch and several springs
  to understand seasonal changes and frog use throughout the year.4. Conduct inventory
  and assessment of moist soil plants on both Conboy Lake and Toppenish NWRs, in conjunction
  with ongoing waterfowl surveys, to evaluate and inform management actions within
  moist soil units.5. Conduct surveys of amphibians and reptiles at Toppenish NWR
  to determine occupancy and establish baseline populations within managed wetlands.\",\n\t\"license_title\":
